function Gallery() {
    return (
      <div className="mt-16  pt-10 py-12  mx-auto max-w-4xl">
        <p className=" lg:text-6xl  font-['Inter-ExtraBold']">
            All Projects
          </p>
        <h1 className="text-4xl text-left font-['Myfont'] max-md:max-w-full">
            Here is a some artwork I have made in my spare time 
        </h1>
      </div>
    );
}

export default Gallery;
